This past weekend was one of the greatest trips I’ve ever been on. A bunch of friends and family got together in Negril, Jamaica to celebrate my loves 30th birthday. We rented out all but 2 rooms at the @thecaveshotel and had the entire place to ourselves. We ate, drank, jumped off high cliffs, sang and danced, sunbathed and cracked jokes for 3 straight days. We told stories of how we met and how much we love Janessa. We got to know one another on levels we didn’t before and we all became one family.

@littlejanessa I couldn’t be more grateful to be your fiancé, and i couldn’t be any more excited for all your birthdays to come. I love you more than you know. I’d celebrate you everyday if i had Bezos money. In due time 😏😘

I love you ‼️ Happy Birthday. #WeDoHardThings #IYKYK 😉

